(window.webpackJsonp=window.webpackJsonp||[]).push([[907],{1261:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1790-xuan-thu-đai-đien-【-canh-thu-hai-】"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1790-xuan-thu-đai-đien-【-canh-thu-hai-】"}},[n._v("#")]),n._v(" Chương 1790: Xuân Thu đại điển? 【 canh thứ hai 】")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1790: Xuân Thu đại điển? "),t("br"),t("br"),n._v("Kẹt kẹt!"),t("br"),t("br"),n._v("Kèm theo thời gian trôi qua, cửa nứt ra khe hở càng lúc càng lớn, Trương Huyền hơi chuyển động ý nghĩ một chút, vội vàng chui vào."),t("br"),t("br"),n._v("Duy trì hơn một tháng thăng cấp, hắn thật muốn nhìn một chút đến cùng xảy ra chuyện gì dạng biến hóa!"),t("br"),t("br"),n._v("Đi vào mi mắt, vẫn như cũ là vô số giá sách cùng thư tịch, che khuất bầu trời, liếc mắt không nhìn thấy cuối cùng."),t("br"),t("br"),n._v("Mới vừa đạt được thư viện thời điểm, nơi này chỉ là chút hư ảo sách, mà bây giờ, đã bị chân thực sách lấp đầy, rực rỡ muôn màu, không biết bao nhiêu."),t("br"),t("br"),n._v("Cùng nhau đi tới, thời gian hơn một năm, nhìn qua sách, tuyệt đối được xưng tụng đại lục đệ nhất nhân, lại không người có thể ra hắn bên trên."),t("br"),t("br"),n._v("Nhất là tại núi sách bên trong, thời gian mặc dù không dài, nhìn thư tịch lại bao gồm từ xưa đến nay tất cả kiến thức cùng biến thiên, để cả người hắn bất luận tâm cảnh hay là trí tuệ, đều có tăng lên trên diện rộng."),t("br"),t("br"),n._v("“Ừm? Nơi này nhiều hơn một đạo cầu thang...”"),t("br"),t("br"),n._v("Dọc theo thư viện đi vào trong, đi tới không xa, ánh mắt lộ ra nghi ngờ."),t("br"),t("br"),n._v("Trước đó thư viện, tuy là thoạt nhìn cao vút, cũng chỉ có một tầng, mà bây giờ, vậy mà xuất hiện cầu thang, chẳng lẽ, mặt trên còn có?"),t("br"),t("br"),n._v("Bàn chân hướng cầu thang đạp đi, mới đi một bước, kìm lòng không được đánh cái lảo đảo, suýt chút nữa ngã sấp xuống."),t("br"),t("br"),n._v("“Đây là giả?”"),t("br"),t("br"),n._v("Vẻ mặt trở nên khó coi."),t("br"),t("br"),n._v("Trước mắt xuất hiện bộ này cầu thang, vậy mà cùng trước đó thư tịch đồng dạng, là hư ảo, đừng nói đi lên, đụng chạm đều đụng chạm không đến."),t("br"),t("br"),n._v("Trước đó không có, bây giờ lại nhiều ra một hàng hư ảo cầu thang, làm cái gì?"),t("br"),t("br"),n._v("“Chẳng lẽ cùng trước đó thư tịch đồng dạng, cần gặp phải chân chính cầu thang, mới có thể bổ sung hoàn chỉnh?”"),t("br"),t("br"),n._v("Âm thầm phỏng đoán."),t("br"),t("br"),n._v("Mới vừa đạt được thư viện, phía trên thư tịch chính là như vậy, thấy được bắt không, là về sau, nhìn không biết bao nhiêu sách, mới bổ sung hoàn chỉnh, chẳng lẽ cái này cầu thang cũng tương đồng a?"),t("br"),t("br"),n._v("Chỉ là... Đọc sách hắn có kinh nghiệm, cầu thang làm sao bổ?"),t("br"),t("br"),n._v("“Mặc kệ...”"),t("br"),t("br"),n._v("Nghĩ nửa ngày cũng không biết nên làm cái gì, Trương Huyền lắc đầu, tiếp tục đi đến phía trước, một lát sau lần nữa ngừng lại."),t("br"),t("br"),n._v("Không chỉ xuất hiện một cái cầu thang, dường như kết cấu bên trong, cũng có biến hóa, chẳng biết lúc nào, thư viện chỗ sâu, xuất hiện một cái yên tĩnh gian phòng."),t("br"),t("br"),n._v("Từ bên ngoài thoạt nhìn, giống như là một bản to lớn thư tịch."),t("br"),t("br"),n._v("“Phòng đọc?”"),t("br"),t("br"),n._v("Lần nữa lộ ra nghi ngờ."),t("br"),t("br"),n._v("Bình thường thư viện, đều có thể xem đọc sách địa phương, trước đó nơi này không có, cũng liền không nghĩ nhiều, chẳng lẽ, lần này thăng cấp về sau, có loại này vị trí?"),t("br"),t("br"),n._v("Có thể hay không vào xem sách, lại so với ngoại giới càng nhanh một ít?"),t("br"),t("br"),n._v("Đẩy cửa đi vào."),t("br"),t("br"),n._v("Cánh cửa này, cùng cầu thang không giống, có thể ung dung đẩy ra, vừa tiến vào trong, vẻ mặt lập tức thay đổi."),t("br"),t("br"),n._v("“Nơi này tốc độ thời gian trôi qua, cùng ngoại giới vậy mà khác biệt?”"),t("br"),t("br"),n._v("Lấy hắn đối thời gian pháp tắc lý giải, có thể tuỳ tiện cảm ngộ ra, nơi này tốc độ thời gian trôi qua, cùng ngoại giới hoàn toàn khác biệt."),t("br"),t("br"),n._v("“Có lẽ là... 1: 10!”"),t("br"),t("br"),n._v("Nắm đấm xiết chặt."),t("br"),t("br"),n._v("1: 10 tốc độ thời gian trôi qua, nói cách khác, ở đây tu luyện mười ngày, ngoại giới mới đi qua một ngày!"),t("br"),t("br"),n._v("“Bất quá, nếu như chỉ là ý thức đi vào nơi này, nhiều nhất có thể rèn luyện võ kỹ, đối tu luyện không có quá lớn trợ giúp!”"),t("br"),t("br"),n._v("Hưng phấn sau đó, cũng rõ ràng thiếu sót."),t("br"),t("br"),n._v("Thư viện chỉ có thể ý niệm tiến vào bên trong, cùng Trương gia huyết trì có chút tương tự, nhiều nhất rèn luyện tinh thần, cùng đối võ kỹ, công pháp lý giải, đối tự thân tu vi, trên thực tế không có quá lớn trợ giúp."),t("br"),n._v(" Thiên đạo công pháp, tu luyện vốn cũng không phức tạp, coi như tăng thêm gấp mười lần tốc độ, đối với hắn mà nói, hiệu quả cũng không lớn."),t("br"),t("br"),n._v("Một canh giờ tăng lên một cái cấp bậc, cùng mười hai phút tăng lên một cái... Khác biệt rất lớn ư?"),t("br"),t("br"),n._v("Dường như, thật không tính là gì."),t("br"),t("br"),n._v("Dù sao, một canh giờ thời gian, hay là không cảm thấy quá lãng phí."),t("br"),t("br"),n._v("Lắc đầu, chính giác đến chức năng này mười phần gân gà, tinh thần đột nhiên động một cái, cảm thấy chân khí trong cơ thể, vậy mà kèm theo ý niệm của hắn, bắt đầu vận chuyển lại."),t("br"),t("br"),n._v("“Không đúng... Ở đây, ta có thể điều động lực lượng trong cơ thể, dựa theo nơi này tốc độ thời gian trôi qua tiến hành tu luyện, nói cách khác... Tuy là bản thể không cách nào đi vào, lại đồng dạng nắm giữ tăng thêm gấp mười lần tốc độ tu luyện...”"),t("br"),t("br"),n._v("Con mắt sáng lên, Trương Huyền tràn đầy kích động."),t("br"),t("br"),n._v("Còn tưởng rằng, thứ này chỉ là bộ dáng sống, không nghĩ tới cường đại như thế!"),t("br"),t("br"),n._v("Đoạn tuyệt tại Danh Sư đường, khôi phục thực lực, hắn hao tốn trọn một tháng thời gian, có thứ này, ba ngày liền có thể triệt để khôi phục!"),t("br"),t("br"),n._v("Bình thường đứt ngón tay, cụt tay, đoán chừng một, hai cái hô hấp liền có thể khôi phục lại!"),t("br"),t("br"),n._v("“Như vậy, không chỉ tốc độ tu luyện tăng tốc, tốc độ khôi phục cũng sẽ gia tăng thật lớn, lại không sợ bị thương...”"),t("br"),t("br"),n._v("Nắm giữ Thiên đạo công pháp, tiến bộ khẳng định không chậm, chỉ khi nào làm bị thương căn bản, khôi phục thực sự quá chậm."),t("br"),t("br"),n._v("Liền giống như lần này, hao tốn trọn một tháng thời gian, thật muốn có người nhân cơ hội giết tới, cũng chưa chắc có thể chống lại."),t("br"),t("br"),n._v("Mà bây giờ, có gian phòng này, giải quyết triệt để."),t("br"),t("br"),n._v("Gấp mười lần thời gian, có thể đủ lượng biến dẫn tới biến chất, để hắn hướng cao hơn phương hướng tiến lên."),t("br"),t("br"),n._v("“Không chỉ có như vậy, tại đây tu luyện, tư duy càng thêm rõ ràng, cho người ta một loại thân ở Khổng miếu cảm giác...”"),t("br"),t("br"),n._v("Mỉm cười."),t("br"),t("br"),n._v("Trong phòng chỉ đợi một hồi, cũng cảm giác dường như có vô số văn vận, tràn vào trong đầu, để hắn tư duy càng thêm rõ ràng, cả người sảng khoái tinh thần, ý niệm thông suốt."),t("br"),t("br"),n._v("Tại chỗ củng cố một hồi tu vi, cảm thấy Tâm Huyết Lai Triều cảnh triệt để củng cố, bất cứ lúc nào cũng sẽ đột phá đến Bất Hủ cảnh."),t("br"),t("br"),n._v("Lần này thăng cấp, khó trách thời gian dài, so trước kia quả thực ra sức hơn nhiều."),t("br"),t("br"),n._v("Mặc kệ cầu thang hay là gian phòng này, đều tương đương với tại trong thư viện, gia nhập mới nguyên tố."),t("br"),t("br"),n._v("Đẩy cửa ra khỏi phòng, ý niệm đang muốn quay về bản thể, Trương Huyền đột nhiên sững sờ tại nguyên chỗ."),t("br"),t("br"),n._v("“Đây là cái thư tịch, có thể sửa đổi thời gian, sẽ không phải là... Xuân Thu đại điển a?”"),t("br"),t("br"),n._v("Xuân Thu đại điển bị Lạc Nhược Hi luyện hóa, điểm ấy hắn tận mắt nhìn thấy, nhưng đối phương rời đi về sau, hắn liền lâm vào hôn mê, thư viện bắt đầu thăng cấp."),t("br"),t("br"),n._v("Xuân Thu đại điển, nắm giữ sửa đổi thời gian năng lực, điểm ấy danh sư đại lục đỉnh phong danh sư, người người đều biết, thư viện đột nhiên cũng xuất hiện loại năng lực này, để hắn tình không bản thân lộ ra nghi ngờ."),t("br"),t("br"),n._v("Vội vàng hướng trước mắt gian phòng nhìn lại."),t("br"),t("br"),n._v("Cùng thư tịch giống nhau như đúc, vừa rồi không có chú ý, giờ phút này cẩn thận cảm thấy, quả nhiên cùng lúc trước nhìn thấy Xuân Thu đại điển, giống nhau y hệt."),t("br"),t("br"),n._v("Đại điển mặc dù không tiếp xúc qua, xuất hiện thời điểm, lại chuyên môn nhìn qua liếc mắt, mang đến cho hắn một cảm giác cùng gian phòng này không khác chút nào, chỉ bất quá... Người sau giống như là bệnh liệt dương bản đồng dạng, không có như vậy nồng đậm khí tức thôi."),t("br"),t("br"),n._v("“Chẳng lẽ... Nàng đem Xuân Thu đại điển, đặt ở nơi này, lúc này mới đã dẫn phát thư viện thăng cấp?”"),t("br"),t("br"),n._v("Nắm đấm xiết chặt, Trương Huyền khắp khuôn mặt là khó tin."),t("br"),t("br"),n._v("Lạc Nhược Hi biết thư viện tồn tại, hắn là tại cuối cùng mới biết, đã chấn kinh tột đỉnh, chẳng lẽ... Còn có thể đem Xuân Thu đại điển để vào trong đó, để cả hai triệt để tương dung, hình thành như vậy một cái phòng?"),t("br"),t("br"),n._v("Thật hay giả?"),t("br"),t("br"),n._v("Nếu thực như thế, nàng đến cùng người nào?"),t("br"),t("br"),n._v("Lại cùng Thiên đạo thư viện, lại có quan hệ ra sao?"),t("br"),t("br"),n._v("Trong nháy mắt, Trương Huyền trong đầu tràn đầy hoảng hốt, cả người đều ngây dại."),t("br"),t("br"),n._v("Chênh lệch từ từ nhỏ dần, phiền phức có phiếu, gửi cho lão nhai! Cám ơn!"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1801"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1803"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);